	add("attack", "{\"term\":\"attack\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"{{borrowing|fr|attaque|lang\u003den}}, derived from the verb \u0027attaquer\u0027 from Italian \u0027attaccare\u0027 (lang\u003dit) used in \u0027\u0027 (attaccare battaglia) Cognate with Italian \u0027attacca\u0027 and German \u0027attacke\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An attempt to cause damage or injury to, or to somehow detract from the worth or credibility of, a person, position, idea, object, or thing, by physical, verbal, emotional, or other assault\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/global-development/2013/jul/12/war-denying-children-education Denied an education by passage\u003dOne particularly damaging, but often ignored, effect of conflict on education is the proliferation of \u0027\u0027attacks\u0027\u0027 on schoolsas children, teachers or school buildings become the targets of \u0027\u0027attacks\u0027\u0027. Parents fear sending their children to school. Girls are particularly vulnerable to sexual violence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A time in which one attacks. The offence of a battle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Collectively, the bowlers of a cricket side\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any contact with the ball other than a serve or block which sends the ball across the plane of the net\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The three attackmen on the field or all the attackmen of a team\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The sudden onset of a disease\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An active episode of a chronic or recurrent disease\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The onset of a musical note, particularly with respect to the strength (and duration) of that onset\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The amount of time it takes for the volume of an audio signal to go from zero to maximum level (e.g. an audio waveform representing a snare drum hit would feature a very fast attack, whereas that of a wave washing to shore would feature a slow attack\", \"priority\":10}]}, \"synonyms\":{}}");

