	add("atter", "{\"term\":\"atter\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"Dutch\", \"Norwegian\", \"scots\", \"saterfriesisch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027atter\u0027 \u0027ater\u0027 from Old english (ca. 450-1100) {{m|ang|āttor}}, {{m|ang|ǣttor}}, {{m|ang|ātor||poison}}, from Proto-germanic {{m|gem-pro|*aitrą||gland, matter}}, from Proto-indo-european {{m|ine-pro|*ayd-}}, {{m|ine-pro|*oyd-||tumor, abscess}}. Cognate with Scots \u0027attir\u0027 (corrupt matter, pus) Scots \u0027atter\u0027 \u0027etter\u0027 (poison, venom) Saterfriesisch \u0027atter\u0027 (pus) Dutch \u0027etter\u0027 (pus) German \u0027eiter\u0027 (poison, pus) Danish \u0027edder\u0027 \u0027ædder\u0027 (venom) Swedish \u0027etter\u0027 (poison, venom, virulence) Norwegian \u0027eiter\u0027 (venom) Icelandic \u0027eitur\u0027 (poison)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Poison, venom, especially of a venomous animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Pus, corrupt or morbid matter from a sore or wound\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Epithelium produced on the tongue\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A scab; a dry sore\", \"priority\":4}]}, \"synonyms\":{}}");

