	add("attender", "{\"term\":\"attender\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An attendee; one who attends a course, meeting etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, William Ellis, Alice Ellis and James Backhouse, \u0027The Life and Correspondence of William and Alice Ellis, of Airton\u0027, page 305, H. Longstret\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She was a very constant \u0027\u0027attender\u0027\u0027 of First-day and week-day meetings, at the meeting places she belonged t\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, James Wideman Lee, Naphtali Luccock and James Main Dixon, \u0027The Illustrated History of Methodism\u0027, page 345, The Methodist Magazine Publishing Co\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And she continued her infamous trade of procuress, while a zealous and regular \u0027\u0027attender\u0027\u0027 of the Tabernacle at Tottenham-Court\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1950\u0027\u0027, Harold Spears, \u0027The High School for Today\u0027, page 2, American Book Co\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The great distance that some youth travel\u0027...\u0027is bound to play its part in the case of the borderline student who becomes an infrequent \u0027\u0027attender\u0027\u0027 and finally drops out of school\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Linda Woodhead and Paul Heelas, \u0027Religion in Modern Times: An Anthology\u0027, page 401, Blackwell Publishin\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"If there is no spiritual distinction between member and \u0027\u0027attender\u0027\u0027, the question is asked,\u0026lt;!--punctuation sic.--\u0026gt; Why have membership at all\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The subject; one who experiences\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1873\u0027\u0027, Sara S. Hennell, \u0027Present Religion: As a Faith Owning Fellowship with Thought\u0027, page 159, Trübner and Co\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"the whole process of ages’-long mentalization, of which our present ability of conceiving “Mind” forms only the culmination, and by no means the constant \u0027\u0027attender\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027, Wilmon Henry Sheldon, \u0027God and Polarity: A Synthesis of Philosophies\u0027, page 48, Yale University Pres\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Activity of attention for the sake of knowledge changes only the mind of the \u0027\u0027attender\u0027\u0027 and is resisted only by the habits, biases, laziness and the lik\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 July, Daniel A. Helminiak, \u0027The Human Core of Spirituality: Mind as Psyche and Spirit\u0027, page 53, State University of New York Pres\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The other aspect pertains to the subject’s own subjectivity, those qualities that constitute the subject as the experiencer or \u0027\u0027attender\", \"priority\":16}]}, \"synonyms\":{}}");

	add("attention", "{\"term\":\"attention\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027attencioun\u0027 from Latin \u0027attentio\u0027 from \u0027\u0027 past participle \u0027attentus\u0027 () see attend.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mental focus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dIn the old days, to my commonplace and unobserving mind, he gave no evidences of genius whatsoever. He never read me any of his manuscripts,\u0026amp;nbsp;[\u0026amp;hellip;], and therefore my lack of detection of his promise may in some degree be pardoned. But he had then none of the oddities and mannerisms which I hold to be inseparable from genius, and which struck my \u0027\u0027attention\u0027\u0027 in after days when I came in contact with the Celebrity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dOne saint\u0027s day in mid-term a certain newly appointed suffragan-bishop came to the school chapel, and there preached on “The Inner Life.”\u0026amp;nbsp; He at once secured \u0027\u0027attention\u0027\u0027 by his informal method, and when presently the coughing of Jarvis […] interrupted the sermon, he altogether captivated his audience with a remark about cough lozenges being cheap and easily procurable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/the-british-longitude-act-reconsidered The British Longitude Act passage\u003dBut was it responsible governance to pass the Longitude Act without other efforts to protect British seamen? Or might it have been subterfuge—a disingenuous attempt to shift \u0027\u0027attention\u0027\u0027 away from the realities of their life at sea\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An action or remark expressing concern for or interest in someone or something, especially romantic interest\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1818\u0027\u0027, \u0027; or, the Modern Prometheus\u0027, ch. 3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"She attended her sickbed; her watchful \u0027\u0027attentions\u0027\u0027 triumphed over the malignity of the distemper\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1910\u0027\u0027, \u0026quot;s:How to Avoid Getting How to Avoid Getting Married,\u0026quot; in \u0027s:Literary Literary Lapses\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"For some time past I have been the recipient of very marked \u0027\u0027attentions\u0027\u0027 from a young lady\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A state of alertness in the standing position\", \"priority\":10}]}, \"synonyms\":{}}");

