	add("attenuation", "{\"term\":\"attenuation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|attenuātiō||a diminishing}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A gradual diminishing in the strength of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A reduction in the level of some property with distance, especially the amplitude of a wave or the strength of a signal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A weakening in the virulence of a pathogen or other microorganism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The tapering of a leaf etc to a fine point\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A fabrication process in which a material is stretched out into a thin shape\", \"priority\":5}]}, \"synonyms\":{}}");

	add("attery", "{\"term\":\"attery\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027attri\u0027 from Old english (ca. 450-1100) {{m|ang|ǣttriġ}}, {{m|ang|ǣtriġ||poisonous}}, equivalent to {{suffix|atter|gloss1\u003dpoison|y|lang\u003den}}. Cognate with Dutch \u0027etterig\u0027 (purulent) German \u0027eiterig\u0027 (purulent, festering) Swedish \u0027ettrig\u0027 (poisonous) Shetlandic \u0027eter\u0027 (poison; bitter cold)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cold, bleak weather\", \"priority\":1}]}, \"synonyms\":{}}");

	add("attestation", "{\"term\":\"attestation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"{{suffix|attest|ation|lang\u003den}}; from Middle french (ca. 1400-1600) {{m|frm|attestation}}, from Latin {{m|la|attestātiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing that serves to bear witness, confirm, authenticate, validation, verification, documentation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A confirmation or authentication\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The process, performed by accountants or auditors, of providing independent opinion on published financial and other business information of a business, public agency, or other organization\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An appearance in print or otherwise recorded on a permanent medium\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Roger Lass, \u0027Historical Linguistics and Language Change\u0027, [http://books.google.com.au/books?id\u003donIXR2xnV5gC\u0026amp;pg\u003dPA23\u0026amp;dq\u003d%22attestation%22%7C%22attestations%22+linguistics\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dUloCUY7MLMbpkAXkiIDQAw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22attestation%22%7C%22attestations%22%20linguistics\u0026amp;f\u003dfalse page 23\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"So something must have been developing over long periods empty of \u0027\u0027attestation\u0027\u0027; and whatever it was, it must (by principles to be discussed in the next section) have been a language of the usual kind\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Ingo Plag, Maria Braun, Sabine Lappe, Mareile Schramm, \u0027Introduction to English Linguistics\u0027, [http://books.google.com.au/books?id\u003dbLvZHmGA8q4C\u0026amp;pg\u003dPA110\u0026amp;dq\u003d%22attestation%22%7C%22attestations%22+linguistics\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dUloCUY7MLMbpkAXkiIDQAw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22attestation%22%7C%22attestations%22%20linguistics\u0026amp;f\u003dfalse page 110\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"For each word, the date of its first \u0027\u0027attestation\u0027\u0027 in the English language, as documented in the \u0027Oxford English Dictionary\u0027, and its frequency of occurrence in the \u0027British National Corpus\u0027 are given\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Kathryn Allan, \u0027Tracing metonymic polysemy through time: MATERIAL FOR OBJECT mappings in the OED\u0027, Margaret E. Winters, Heli Tissari, Kathryn Allan (editors), \u0027Historical Cognitive Linguistics\u0027, [http://books.google.com.au/books?id\u003dRpMdsEA5eXwC\u0026amp;pg\u003dPA176\u0026amp;dq\u003d%22attestation%22%7C%22attestations%22+linguistics\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dUloCUY7MLMbpkAXkiIDQAw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22attestation%22%7C%22attestations%22%20linguistics\u0026amp;f\u003dfalse page 176\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Furthermore, the first \u0027\u0027attestations\u0027\u0027 given in the \u0027OED\u0027 are not always the earliest \u0027\u0027attestations\u0027\u0027 in print; since the first edition was finished in 1928, many earlier and later examples have been identified, and these will be incorporated into the third edition, currently underway (see Durkin 2002 for a discussion of how much this is likely to change the dates of \u0027\u0027attestation\u0027\u0027 in the \u0027OED\u0027 as a whole\", \"priority\":13}]}, \"synonyms\":{}}");

