	add("attitude", "{\"term\":\"attitude\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"From French \u0027attitude\u0027 () from Italian \u0027attitudine\u0027 (attitude, aptness) from \u0027aptitudo\u0027 (aptitude) see aptitude.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The position of the body or way of carrying oneself; posture\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The ballet dancer walked with a graceful \u0027\u0027attitude\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Disposition or state of mind\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"but had a lazy \u0027\u0027attitude\u0027\u0027 to work\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A negative, irritating, or irritated attitude; posturing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t give me your \u0027\u0027attitude\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"You\u0027ve got some \u0027\u0027attitude\u0027\u0027, girl\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The orientation of a vehicle or other object relative to the horizon, direction of motion, other objects, etc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The airliner had to land with a nose-up \u0027\u0027attitude\u0027\u0027 after the incident\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A position similar to arabesque, but with the raised leg bent at the knee\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Gayle Kassing, \u0027History of Dance: An Interactive Arts Approach\u0027, [http://books.google.com/books?id\u003d_lLoTsT2X5EC\u0026amp;pg\u003dPA134\u0026amp;dq\u003d%22attitude%22+ballet\u0026amp;hl\u003den\u0026amp;ei\u003dHKw2TqjxAsSMmQXrx6TwCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CFIQ6AEwCDg\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22attitude%22%20ballet\u0026amp;f\u003dfalse page 134\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Blasis was a man of many accomplishments. He invented the ballet position of \u0027\u0027attitude\u0027\u0027 and codified the ballet technique of that time, distinguishing three types of dancers: the serious, the \u0027demi-caractère\u0027, and the comic dancer\", \"priority\":13}]}, \"synonyms\":{}}");

	add("attoparsec", "{\"term\":\"attoparsec\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|atto|parsec|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit of measure of 10\u0026lt;sup\u0026gt;−18\u0026lt;/sup\u0026gt; parsecs, or about 3.085 centimetres (1.215 inches\", \"priority\":1}]}, \"synonyms\":{}}");

