	add("attraction", "{\"term\":\"attraction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) \u0027attraction\u0027 from Latin \u0027attractio\u0027 from past participle of {{m|la|attrahō}} (\u003d \u0027ad\u0027 + {{m|la|trahō}})\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendency to attract\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The feeling of being attracted\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dWhen you\u0027re well enough off so\u0027s you don\u0027t have to fret about anything but your heft or your diseases you begin to get queer, I suppose. And the queerer the cure for those ailings the bigger the \u0027\u0027attraction\u0027\u0027. A place like the Right Livers\u0027 Rest was bound to draw freaks, same as molasses draws flies\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An event or location that has a tendency to attract visitors\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The sacrifice of pieces in order to expose the enemy king\", \"priority\":5}]}, \"synonyms\":{}}");

