	add("attrition", "{\"term\":\"attrition\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027attritio\u0027 (a rubbing against) from the verb \u0027attritus\u0027 past participle of \u0027atterere\u0027 (to wear) from \u0027ad-\u0027 (to, towards) + \u0027terere\u0027 (to rub)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Wearing or grinding down by friction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The gradual reduction in a tangible or intangible resource due to causes that are passive and do not involve productive use of the resource\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A gradual, natural reduction in membership or personnel, as through retirement, resignation, or death\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The loss of participants during an experiment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Imperfect contrition or remorse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The wearing of teeth due to their grinding\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The loss of a first or second language or a portion of that language\", \"priority\":7}]}, \"synonyms\":{}}");

