	add("attuition", "{\"term\":\"attuition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supposed form of apprehension midway between sensation in animals and perception in human beings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, S. S. Laurie, \u0026quot;The Growth of Mind,\u0026quot; \u0027The School Review\u0027, vol. 6, no. 2, p. 83n\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But what of non-rational beings—the animal or infant-man of \u0027\u0027attuition\", \"priority\":3}]}, \"synonyms\":{}}");

